import './foodTable.css'
import React from 'react'

const FoodTable = () => {
    const isTabletOrMobile = useMediaQuery({query: '(max-width:1224px)'})    

    return(
        <div>
            {isTabletOrMobile ? (
                <div>
                    <table>
                        <th>Name</th>
                        <tr>Reis</tr>
                    </table>
                </div>
            ) : (
                <div>
                    Food
                </div>
            )}
        </div>
    )
}

export default FoodTable;
